import React from 'react'
import { items } from '../items'

export default class Detail extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            items: items
        }
    }

    componentDidMount(){
        this.setState({items: items})
    }

    render(){
        return (
            <div >
              <items title={this.state.items} />
            </div>
        )
    }
}
